INSERT INTO `v10` VALUES (1,'-1500000','Earliest control of fire, by Homo erectus (Koobi Fora, Kenya): uniquely human capability → extending the day with firelight; improving nutrient uptake with cooked food by 780,000 years ago; widespread use of fire by 400,000 years ago'),(2,'-122500','Prelude to Earth’s Last Glacial Period: global average temperature never again as high until CE 2021, during intensifying anthropogenic warming'),(3,'-39500','Most recent reversal of Earth’s magnetic poles, lasting 500 years, decreasing stratospheric ozone, driving global climate shifts and extinction events'),(4,'-10800','Climate shift contributing to megafaunal extinctions and human cultural changes (Younger Dryas): triggered by a comet airburst over North America and Europe?'),(5,'-2000','Earliest use of coal as fuel (Inner Mongolia and Shanxi, China), for smelting copper, cooking, heating → peak global coal production of 8.2 billion tonnes/year in CE 2013?'),(6,'290','Firing of natural gas in southwest China, to boil brine for salt (Bowu zhi c. 290), and to pipe into homes for lighting (Huayang Guo Zhi c. 340) → 3.9 trillion m³/year of global gas extraction by 2018 and rising'),(7,'536','Crop failures across the northern hemisphere caused by volcanic eruptions in Iceland; then bubonic plague (536-547) → century of economic stagnation'),(8,'1044','Formula for gunpowder, used for fire arrows, incendiary projectiles, smoke bombs (Northern Song dynasty, China, Wujing Zongyao 1044) → cannons by 1128, guns by c. 1270, rockets by 1272'),(9,'1346','Bubonic plague caused by the Black Death bacillus Yersinia pestis kills a third of the human population across much of Europe, 1346-53; originating in Kyrgyzstan or the Himalayas, transmitted by rats and their fleas'),(10,'1780','Mass production of spun textiles, mechanised by water power; coal-fired and steam-powered production of iron and steel (beginning Britain, c. 1780) → economies of scale, rising polarisation of rich and poor nations, dominance of fossil fuels'),(11,'1882','First commercially viable power stations, coal-fired (London and New York, 1882) → electrical grid; fossil fuels providing 63% of global electricity generation by 2019'),(12,'1954','First nuclear power plant (Obninsk, USSR, 1954) → advent of clean energy: 10% of global electricity generation in 2019; radioactive waste; nuclear catastrophes, including Chernobyl, Ukraine, 26/4/1986');
